import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '../materialUiComps/Typography';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  img: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  photos: {
    justifyContent: 'center',
  },
  title: {
    textAlign: 'center',
    color: 'gray',
  },
  description: {
    padding: 20,
    color: 'white',
    backgroundColor:'gray',


  }

}));
function Presentation() {
  return (
    <div uk-slideshow>
      <ul class="uk-slideshow-items">
          <li>
              <img src="https://1000logos.net/wp-content/uploads/2018/04/United-Way-Logo.png" alt="" uk-cover></img>
          </li>
      </ul>
      <a class="uk-position-center-left uk-position-small uk-hidden-hover" href="#" uk-slidenav-previous uk-slideshow-item="previous"></a>
      <a class="uk-position-center-right uk-position-small uk-hidden-hover" href="#" uk-slidenav-next uk-slideshow-item="next"></a>
  </div>


  )
};
export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <React.Fragment>
    <br></br>
       <Typography variant="h3" marked="center" align="center" component="h2">
          Our Partnerships
      </Typography>
      <br></br>
      <Grid container className={classes.photos}>
          <img src="https://3.bp.blogspot.com/_-VxKllBZXP4/TR1CMAFj9tI/AAAAAAAAA_A/5bNOcaN5H54/s1600/10_GSUSA_servicemarkc.png"width="280" height="150"></img>
          <img src="https://1000logos.net/wp-content/uploads/2018/04/United-Way-Logo.png" width="280" height="150"></img>
          <img src="https://tano.org/wp-content/uploads/2014/12/Habitat-logo-transparent-color.png"width="280" height="150"></img>
      </Grid>
      <br></br>
      <Grid container>
        <Grid item sm className={classes.description}>
          <Paper className={classes.title}> Our Vision </Paper>
          <br></br>
          <Container>Tieri na reno voti eto tocecik si cewi. Ti turieler mura biedakus. Ofumufe rev ehe codetien tileci utone tir 
          isodara pan. Ye enacelon icim sani nuroran la idis idodief: Uviebi dieyucet na aro afu gesikay, pi iesele laso icecel rerit 
          lom tap ucasoral, terar piloh betac. Rayiheg fetic siret hud rilodet sures wotiquh. Mine atelitim iqagi rini ce soho tili
           renoma uriete; </Container>
        </Grid>
        <Grid item sm className={classes.description}>
          <Paper className={classes.title}> Our Mission </Paper>
          <br></br>
          <Container>Tieri na reno voti eto tocecik si cewi. Ti turieler mura biedakus. Ofumufe rev ehe codetien tileci utone tir 
          isodara pan. Ye enacelon icim sani nuroran la idis idodief: Uviebi dieyucet na aro afu gesikay, pi iesele laso icecel rerit 
          lom tap ucasoral, terar piloh betac. Rayiheg fetic siret hud rilodet sures wotiquh. Mine atelitim iqagi rini ce soho tili
          renoma uriete; </Container>
      </Grid>
      <Grid item sm className={classes.description}>
          <Paper className={classes.title}> Our Programs </Paper>
          <br></br>
          <Container>Tieri na reno voti eto tocecik si cewi. Ti turieler mura biedakus. Ofumufe rev ehe codetien tileci utone tir 
          isodara pan. Ye enacelon icim sani nuroran la idis idodief: Uviebi dieyucet na aro afu gesikay, pi iesele laso icecel rerit 
          lom tap ucasoral, terar piloh betac. Rayiheg fetic siret hud rilodet sures wotiquh. Mine atelitim iqagi rini ce soho tili
          renoma uriete; </Container>    
    </Grid>
      </Grid>
      <Presentation />



    </React.Fragment>
  );
}

